import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import FoodCars from './components/FoodCars';
import Shoplist from './components/Shoplist';
import Subscription from './components/Subscription';
import Login from './components/Login';
import AboutUs from './components/AboutUs';
import MonthlyPrice from './components/MonthlyPrice';
import Home from './pages/Home'; // Home Page
import Partners from './pages/PartnerRegistration'; // Partners Page

const App = () => {
  return (
    <Router>
      <Navbar /> {/* Common navigation bar */}
      <Routes>
        <Route path="/" element={<Home />} /> {/* Home page */}
        <Route path="/partners" element={<Partners />} /> {/* Partners page */}
        <Route path="/foodcars" element={<FoodCars />} /> {/* Food Cars component */}
        <Route path="/shop" element={<Shoplist />} /> {/* Shop list */}
        <Route path="/subscription" element={<Subscription />} /> {/* Subscription plans */}
        <Route path="/about" element={<AboutUs />} /> {/* About Us */}
        <Route path="/login" element={<Login />} /> {/* Login page */}
        <Route path="/pricing" element={<MonthlyPrice />} /> {/* Monthly pricing */}
      </Routes>
    </Router>
  );
};

export default App;
